import React from 'react';

function Prices() {
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>Our Pricing</h1>
      <p>Choose a plan that suits your needs:</p>
      <ul style={{ listStyle: 'none', padding: 0 }}>
        <li style={{ margin: '10px 0' }}>
          <strong>Basic Plan:</strong> $99/month - Perfect for small businesses.
        </li>
        <li style={{ margin: '10px 0' }}>
          <strong>Pro Plan:</strong> $199/month - Advanced features for scaling.
        </li>
        <li style={{ margin: '10px 0' }}>
          <strong>Enterprise Plan:</strong> Custom pricing - Tailored solutions for large organizations.
        </li>
      </ul>
    </div>
  );
}

export default Prices;
